import React from "react";

export default class ArticleFeed extends React.Component {
  state = {
    articles: []
  };

  render() {
    return (
      <div>
        ARTICLES
        <ul>
          <li></li>
        </ul>
      </div>
    );
  }

  componentDidMount() {
    this.fetchArticles();
  }

  fetchArticles = () => {
    applicationCache.getArticles().then(articles => {
      this.setState({ articles: articles });
    });
  };
}
